import React from 'react';
import Navbar from '../components/Navbar';
import WaitlistForm from '../components/WaitlistForm';
import FeatureIcons from '../components/FeatureIcons';
import './HomePage.css';

const HomePage = () => {
    return (
        <div className="home-page-container">
            <Navbar />
            <div className="content">
                <h1>
                    Cheat on <span className="gradient-text">everything.</span>
                </h1>
                <h2>
                    Everything Cluely does, but <span className="green-text">completely free.</span>
                </h2>
                <p className="subtitle">Join thousands of students already on the waitlist</p>
                <WaitlistForm />
                <div className="footer-notes">
                    <p><span className="green-dot"></span> No credit card required</p>
                    <p><span className="blue-dot"></span> 100% free forever</p>
                </div>
            </div>
            <FeatureIcons />
        </div>
    );
};

export default HomePage;
